import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";

const inspectors = [
  { name: "Johan Svensson", lake: "Lugnet", phone: "070-123 45 67" },
  { name: "Mats Andersson", lake: "SÃ¤bylundssjÃ¶n", phone: "070-987 65 43" },
  { name: "Abed Balhawan", lake: "NolsjÃ¶n", phone: "070-xxx xx xx" }
];

function Contact() {
  const location = useLocation();
  const [contactType, setContactType] = useState("general");

  // Kolla query-param fÃ¶r att visa rÃ¤tt typ
  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const type = params.get("type");
    if (type) setContactType(type);
  }, [location]);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Kontakt</h1>

      {/* AllmÃ¤n kontakt */}
      {contactType === "general" && (
        <>
          <h2>AllmÃ¤n kontakt</h2>
          <form>
            <input
              type="text"
              placeholder="Ditt namn"
              style={{ display: "block", marginBottom: "10px", padding: "8px", width: "100%" }}
            />
            <input
              type="email"
              placeholder="Din e-post"
              style={{ display: "block", marginBottom: "10px", padding: "8px", width: "100%" }}
            />
            <textarea
              placeholder="Meddelande"
              style={{ display: "block", marginBottom: "10px", padding: "8px", width: "100%", minHeight: "100px" }}
            />
            <button type="submit" style={{ padding: "10px 20px", cursor: "pointer" }}>Skicka</button>
          </form>
        </>
      )}

      {/* TillsynsmÃ¤n */}
      {contactType === "inspectors" && (
        <>
          <h2>TillsynsmÃ¤n</h2>
          <ul style={{ listStyleType: "none", padding: 0 }}>
            {inspectors.map(ins => (
              <li
                key={ins.name}
                style={{
                  backgroundColor: "#f0f8ff",
                  marginBottom: "10px",
                  padding: "10px",
                  borderRadius: "6px",
                  border: "1px solid #ccc"
                }}
              >
                <strong>{ins.name}</strong> â€“ {ins.lake} â€“ ðŸ“ž {ins.phone}
              </li>
            ))}
          </ul>
        </>
      )}
    </div>
  );
}

export default Contact;
